import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Header.css';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import './profile.css'; // Import profile.css

export const Header = () => {
  const GoGirlStyle = {
    fontSize: '24px',
  };

  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  return (
    <>
      <div className='navbarStart'>
        <Link className='navbarStartLinks' to='/'>
          <b>
            <span style={GoGirlStyle}>Placement Guidance Bot</span>
          </b>
        </Link>
        <Link className='navbarStartLinks' to='/'>Home</Link>
        <Link className='navbarStartLinks' to='/about'>About</Link>
        <div className='dropdown ml-auto'> {/* ml-auto to align right */}
          <button className='btn btn-secondary dropdown-toggle' type='button' id='dropdownMenuButton' onClick={toggleDropdown}>
            <i className='bi bi-person'></i> {/* Bootstrap person icon */}
          </button>
          <div className={`dropdown-menu ${dropdownOpen ? 'show' : ''}`} aria-labelledby='dropdownMenuButton'>
            <Link className='dropdown-item' to='/profile'>Profile</Link>
            <Link className='dropdown-item' to='/history'>History</Link>
            <Link className='dropdown-item' to='/logout'>Log Out</Link>
          </div>
        </div>
      </div>
    </>
  );
};
